message:
Ситуацию вокруг Украины сегодня обсудят в двух форматах:

- НАТО по инициативе премьер-министра Великобритании созвала экстренный саммит на 16:00 по Киеву. Вероятно, обсудят укрепление восточного фланга;

- Совет Безопасности ООН в 22:00 по Киеву будет голосовать за резолюцию, осуждающую вторжение России в Украину. Правда, шансов принять её практически нет – помимо самой России, право вето в СБ ООН есть у Китая, который до сих пор как минимум не выступал против российской военной операции.

На повестке дня Верховной Рады будут рассматривать следующее:  

▪️Персональные санкции против граждан России;
▪️Легализация гражданского огнестрельного оружия; 
▪️Передача на нужды ВСУ имущества образовательной сферы, которое не используется;
▪️Увеличение трат на нужды армии, дополнительное финансирование территориальной обороны.
